Task Name: mboxIn_uartOut_TASK
Description: The Task is used to handle all the messages received from Mailbox virtual channel.
APIs: Semaphore_pend
Mailbox_readFlush
UART_writePolling
______________________________________________________________________________________________
/* wait for new message and process all the messages received from the peer (DSS)*/
while TRUE
Semaphore_pend(gMSSMCB.mboxSemHandle, BIOS_WAIT_FOREVER)
/* Flush out the contents of the mailbox to indicate that we are done with the message.
This will allow us to receive another message in the mailbox while we process the received message. */
Mailbox_readFlush (gMSSMCB.peerMailbox);
/* Process the received message: */
switch (message.type)
case DSS2MSS_DETOBJ_READY
/* Send the detected objects through UART */
send header:
UART_writePolling();
send TLVs:
UART_writePolling();
